~ $ cd frontend-template
~/frontend-template $ There are just three files (except for README, LICENSE and .gitignore): package.json that declares needed dependencies webpack.config.js needed for the webpack to work index.js that imports fluence js library and shows how to connect to a cluster Let's take a look at index.js : // address of the Fluence smart contract on Ethereum.
