// create a session between client and backend application
fluence.connect(contractAddress, appId, ethUrl).then((s) => { console.log("Session created"); window.session = s; helloBtn.disabled = false;
});
...
// set callback on button click
helloBtn.addEventListener("click", send) // send username as a transaction and display results in grettingLbl
function send() { const username = usernameInput.value.trim(); let result = session.invoke(username); getResultString(result).then(function (str) { greetingLbl.innerHTML = str; });
} This code queries the Fluence smart contract for IP addresses of Tendermint nodes hosting the app with specified appId , creates an AppSession from these connections, and saves it to window.session , so it can be used later. All this is done via connect method. Then, it assigns send() function as a callback for clicking the button, which will call an invoke method provided by AppSession . invoke takes a String , and sends it to the backend as a transaction. Result will be displayed in greeting label.

