From the example above it can be seen that allocate and deallocate functions serve only utility purpose and are normally used only by the VM wrapper . These functions aren't any that most of the developers would want to implement in their app . Fluence backend SDK provides fluence::memory::alloc and fluence::memory::dealloc functions also based on GlobalAlloc . They exported by default after including the sdk and can be disabled by including it with fluence = {default-features = false} . The invoke function can be also simplified by using the Fluence backend SDK that provides fluence::memory::write_result_to_mem and fluence::memory::read_input_from_mem_ in this way: #[no_mangle]
pub unsafe fn invoke(_ptr: *mut u8, _len: usize) -> usize { let test_str = "Hello, world!"; fluence::memory::write_result_to_mem(test_str) .unwrap_or_else(|_| { panic!("[Error] Putting the result string into a raw memory was failed") }) .as_ptr() as usize
} Invocation handler to the rescue The example above can be simplified a little bit more using procedural macros invocation_handler as the hello-world example mentioned in quick start example: use fluence::sdk::*; #[invocation_handler]
fn greeting(name: String) -> String { format!("Hello, world! From user {}", name)
} Internally this macro creates a new function invoke that converts a raw argument to the appropriate format, calls f and then converts its result via memory::write_result_to_mem from fluence_sdk_main . The following listing shows how this macro is expanded: use fluence::sdk::*; fn greeting(name: String) -> String { format!("Hello, world! From user {}", name)
} #[no_mangle]
pub unsafe fn invoke(ptr: *mut u8, len: usize) -> std::ptr::NonNull<u8> { let arg = memory::read_input_from_mem(ptr, len); let arg = String::from_utf8(arg).unwrap(); let result = greeting(arg); memory::write_result_to_mem(result.as_bytes()).expect("Putting result string to memory has failed")
} To use this macro with a function f some conditions have to be satisfied: f mustn't have more than one input argument. f mustn't be unsafe , const , generic, have custom abi linkage or variadic param. The type of f input (if it present) and output parameters have to be one of {String, Vec} set. f mustn't have the name invoke . For troubleshooting and macros debugging cargo expand can be used. The macro also has an init_fn attribute that can be used for specifying initialization function name. This function will be called only in the first invoke function call. It can be used like this: use fluence::sdk::*; fn init() { ...
} #[invocation_handler(init_fn = init)]
fn greeting(name: String) -> String { format!("Hello from Fluence to {}", name)
} This is expanded to use fluence::sdk::*; fn init() { ...
} fn greeting(name: String) -> String { format!("Hello from Fluence to {}", name)
} static mut IS_INITED: bool = false; #[no_mangle]
pub unsafe fn invoke(ptr: *mut u8, len: usize) -> std::ptr::NonNull<u8> { if !IS_INITED { init(); unsafe { IS_INITED = true; } } let arg = memory::read_input_from_mem(ptr, len); let arg = String::from_utf8(arg).unwrap(); let result = greeting(arg); memory::write_result_to_mem(result.as_bytes()).expect("Putting result string to memory has failed")
} Example of usage invocation_handler with init_fn attribure can be found here .

